(4,	NULL,	'Best Playground Equipment for Elementary Kids',	'best-playground-equipment-for-elementary-kids',	'Sanjay Bobde',	'<p><strong>Teachers, Parents, Researchers, and Local Leaders have taken a stand on the value of recess for elementary school children. The Council On School Health, Of The Indian Maharshtra  Academy Of Pediatrics, has adopted a particularly strong position. playground activities as a major element of the whole<a href=\"http://www.parthfibrotech.in/products\"> child -Indoor Gym Equipments, Playground Slides, Playground Combo Set, Merry Go Round, Playground Swings,</a> Playground See-Saw ,Playground Climber, Outdoor Playground Multiplay,</strong></p>',	'd561f35fdbaed9f3ea5018a945380260.jpg',	'2019-11-30',	'active'),
(5,	NULL,	'Benefits of Play for Kids with ADHD/ADD',	'benefits-of-play-for-kids-with-adhdadd',	'Sanjay Sir',	'<p><strong>An active kid is a healthy kid, and that is especially true for kids with attention deficit disorder. Exercise can be one of the best natural ways to help control raising dopamine and norepinephrine baseline levels in the brain. But finding the right activity for your child&#39;s unique set of symptoms is the key to promote happiness and self-confidence and avoid meltdown mode.<br>\n<br>\nThe increased dopamine produced through exercise can help improve attention and focus in people with ADHD, but that&#39;s not all: “Exercise also produces endorphins, the &#39;feel good&#39; chemical in the brain,” Golding said. Exercise also helps children and adults get rid of restless energy, which is a symptom of ADHD.</strong></p>',	'97940d3953de29f016b8c90a960bad44.jpg',	'2019-11-30',	'active'),
(6,	NULL,	'Reasons to convert the community parks into Outdoor Fitness Zones',	'reasons-to-convert-the-community-parks-into-outdoor-fitness-zones',	'Parth Fibrotech',	'<div>Parks are where people relax and unwind. why not transform it into a place where people exercise? Getting some natural air and sun while working out is easy, fun and free. Community parks are a great place to do more extensive exercise as it offers more space. One of the most ideal approaches to blast fat is to train outdoors. Training outdoors provides a different picture from a sweaty, bustling gym to a technology-free zone</div>\n\n<div> </div>\n\n<div>The number of health-conscious people is on the up and gyms can be incredibly occupied at peak times. With expensive memberships and trying to juggle the demands of present-day life, more and more people are opting for outdoor gyms in parks and creating their own workout space.</div>\n\n<div> </div>\n\n<div>Outdoor Green Gyms are becoming popular solutions and over the past few years, a rise in the number of outdoor gyms being installed has increased. The key to creating a productive gym in the parks is to consider the are to be used. When designing a gym, the main thing to consider is the equipment to be installed.</div>\n\n<div> </div>\n\n<div>Why outdoor green gym training is better than a gym workout?</div>\n\n<div> </div>\n\n<div>1.<span xss=removed> </span>It lowers blood pressure and reduces stress.</div>\n\n<div>2.<span xss=removed> </span>It helps with insomnia.</div>\n\n<div>3.<span xss=removed> </span>Enjoy the benefits of sunlight, fresh air, and natural light.</div>\n\n<div>4.<span xss=removed> </span>Free of charge.</div>\n\n<div>5.<span xss=removed> </span>Saves time.</div>\n\n<div>6.<span xss=removed> </span>Variation in your regular exercise.</div>\n\n<div>7.<span xss=removed> </span>Outdoor exercise benefits the entire body by bringing joy, well-being and a better state of mind.</div>\n\n<div> </div>\n\n<div>A diverse outdoor green gym contributes to capital by providing a high quality of life for residents in that community. With increasing urbanization, people are continuously looking for better ways to provide outdoor activities Outdoor exercise is an ideal option. Outdoor Green Gym is allowing individuals to exercise while enjoying natural landscapes in a fresh air environment. </div>\n\n<div> </div>\n\n<div><strong>Benefits of exercising in the open air:</strong></div>\n\n<div> </div>\n\n<div>1.<span xss=removed> </span><strong>Make exercise fun:</strong> Nature and fresh air help make exercising fun and effective. outdoor exercise combined with natural light helps in reducing stress and encouraging healthy behaviours. </div>\n\n<div> </div>\n\n<div>2.<strong><span xss=removed> </span>Are Eco-friendly:</strong> Equipment used in Outdoor Green Gym does not require electricity, is low maintenance and requires very little human resources.</div>\n\n<div> </div>\n\n<div>3.<span xss=removed> </span><strong>Are available to everyone:</strong> The numerous indoor fitness options available are costly and inconvenient. Outdoor Green Gyms helps remove these barriers. Positive change in overall fitness and health of the community can be observed with the installation of Outdoor Green Gyms.</div>\n\n<div> </div>\n\n<div>4.<span xss=removed> </span><strong>Promote friendships</strong>: People who prefer Outdoor Green Gyms often socialize while exercising which strengthens the community and relationships. This helps individuals to interact more readily with each other which leads to offering encouragement, motivation, and support.  </div>\n\n<div> </div>\n\n<div>5.<span xss=removed> </span><strong>Improve health:</strong> Regular exercises are important for good health and longevity. People prefer exercising outdoors, as it has a greater effect on the mental and physical well-being of an individual. Outdoor exercise is more beneficial compared to indoors as the natural environments reduce emotional stress. Exercising outdoors also provides vital exposure to sunlight which increases the levels of vitamin D.</div>\n\n<div> </div>\n\n<div>6.<span xss=removed> </span><strong>Provide training opportunities</strong>: Outdoor Green Gyms are perfect opportunities for fitness trainers to expand their training and the ability to set up training exercises Support Capital Outdoor Green Gyms promote growth in a community. These parks attract health-conscious individuals to the neighbourhood and often impact the behaviour of non-exercising individuals, expanding the benefits related to regular exercise.</div>\n\n<div> </div>\n\n<div>7.<span xss=removed> </span><strong>Outdoor fitness zones attract new people to parks</strong>: The idea of bringing exercise equipment into parks is a way of stimulating physical activity. Exercising outdoors feels less strenuous than similar indoor gym exercises</div>\n\n<div> </div>\n\n<div>Well-planned and innovative Outdoor Green Gym can serve a diverse range of people while also contributing to the overall wellbeing of the community.</div>\n\n<div> </div>\n\n<div><strong>Parth Fibrotech has the solution. They manufacture the best outdoor playground gym equipment’s for the park. Parth Fibrotech offers a wide range of outdoor equipment for your very own outdoor green gym in your backyard. They also provide all kinds of equipment for the overall fitness of the body. They make sure that their products are effective in keeping their clients happy, healthy and fit</strong></div>',	'68bfe7366229e870e010d287a2466b02.jpg',	'2019-12-13',	'active'),
(7,	NULL,	'6 Surprising Academic Perks of Outdoor Playground Equipment',	'6-surprising-academic-perks-of-outdoor-playground-equipment',	'Vijay Sir',	'<p><b xss=\"removed\">Outdoor play</b><span xss=\"removed\"> also enables children to enjoy the natural environment and learn to seek out exercise, fresh air, and activity. There is something fundamentally healthy about using the </span><b xss=\"removed\">outdoors</b><span xss=\"removed\">. Thus </span><b xss=\"removed\">outdoor play</b><span xss=\"removed\"> develops disposition for the </span><b xss=\"removed\">outdoors</b><span xss=\"removed\">, for physical activity, and for care of the environment.</span></p>',	'39f3696b620318ed1adba05e3d7fc1d1.jpg',	'2019-11-29',	'active'),
(8,	NULL,	'How to keep your surroundings clean',	'how-to-keep-your-surroundings-clean',	'Parth Fibrotech',	'<p>Cleanliness is the biggest task in our country. People are littering all over even not they think a single second before throwing it. It’s a huge issue in our country we have to urge people and spread the word among our circle to keep our surroundings clean. We individual should take an initiative if there is no dustbin in your locality you should put a complaint to your nearby corporation.</p>\n\n<p>We are always concern about these issues. We had started implementing on this and start manufacturing Waste Handling Products. Below we have mentioned in details about all our products.</p>',	'f5b9248d79fa17c8d7e5b13bcde0eec6.jpg',	'2019-11-30',	'active'),
(9,	NULL,	'Best outdoor activities for kids',	'best-outdoor-activities-for-kids',	'Parth Fibrotech',	'<p>Every kid should cherish his young age and should make most out of it. Kids grasp all the good or bad things quickly. Parents should also take the responsibilities towards their child always encourage your child to play outdoor games make them extrovert.</p>\n\n<p>It’s a challenge for parents to keep their children entertained over the long summer break. To reduce the times you hear, “I’m bored,” you need to plan.</p>\n\n<p>We are always concerned about kids and we supply the best playing slide equipment’s to the park.</p>\n\n<p> </p>\n\n<p>Some of the activities mentioned below</p>\n\n<ol>\n <li>Cricket</li>\n <li>Football</li>\n <li>Tennis</li>\n <li>Volleyball</li>\n <li>Kabbadi</li>\n</ol>',	'480f8cf7bbac5b16b81c7cc0e8f9901a.jpg',	'2019-11-30',	'active'),
(10,	NULL,	'Top 15 Playground Safety Questions You Need to Ask',	'top-15-playground-safety-questions-you-need-to-ask',	'Parth Fibrotech',	'<p><span xss=\"removed\">Is there enough room for the playground structures that you want to build? The first thing that you need to consider is whether the area that you want to build your playground is large enough for everything that you want to put into it. All playground structures, including slides, climbers, and especially swing sets.</span><br>\n<br>\n </p>\n\n<p> </p>',	'941df2f94c0ea7d09896fefa93a02c32.jpg',	'2019-12-16',	'active'),
(11,	NULL,	'The Best Gym Equipment',	'the-best-gym-equipment',	'parth fibrotech',	'<p>Do you want to reduce your weight and look more attractive? There are many factors that you should consider. You will note that the quest for fitness is on the rise. Nowadays, besides taking a healthy diet, you should consider doing some exercises regularly. You can choose to buy new gym equipment or used gym equipment. If you choose to buy new gym equipment, you might have to dig deeper into your pocket.  We usually have quality used gym equipment that you can buy.</p>\n\n<ul>\n <li>1. Life Fitness signature circuits</li>\n <li>2. Life Fitness Treadmills</li>\n <li>3. Precor Ellipticals</li>\n <li>4. Schwinn indoor cycles</li>\n</ul>',	'f6576af9fdaa08d794cf9cd20aa70524.jpg',	'2019-12-16',	'active'),
(12,	NULL,	'How Outdoor Gym Equipments can strengthen your life?',	'how-outdoor-gym-equipments-can-strengthen-your-life',	'parthfibrotech',	'<p><span xss=\"removed\">Outdoor gym equipments can help you attain a better life. It sounds amazing, right? What if it’s true as well? As we have already discussed the benefits of outdoor workout in our earlier topics: Why Should You Invest In Outdoor Gym Equipments? Outdoor Vs Indoor Gym We would try to enlarge its advantages in this</span></p>',	'e7907c22bde1deb4aa6f4ce9c392711a.jpg',	'2019-12-16',	'active'),
(13,	NULL,	'New Component Playgrounds Location in Pleasant Grove Utah',	'new-component-playgrounds-location-in-pleasant-grove-utah',	'parthfibrotech',	'<p>Swings, slides, <strong>playground</strong> climbers, see saws, merry-go-rounds, spring riders, and tubes are the basics. They all come in a variety of sizes, styles, and themes to fit your <strong>playground&#39;s</strong> uniqueness. The most basic element of a classic <strong>playground</strong> is the swing.</p>\n\n<p>Two of the <strong>most popular playground</strong> pieces that <strong>Play</strong> Mart produces are interactive paint panels and built-in musical instruments</p>\n\n<p>Modern <strong>playgrounds</strong> often have recreational <strong>equipment</strong> such as the seesaw, merry-go-round, swingset, slide, jungle gym, chin-up bars, sandbox, spring rider, trapeze rings, playhouses, and mazes, many of which help children develop physical coordination, strength, and flexibility.</p>',	'220fc1273b77b6778e2cf74632d9081a.jpg',	'2019-12-16',	'active'),
(14,	NULL,	'Parth Highlights Outdoor Furniture for Landscape',	'parth-highlights-outdoor-furniture-for-landscape',	'Parth Fibrotech',	'<p>Parth commercial outdoor furniture manufacturers,  provides designers, specifiers and landscape with lots of colorful outdoor seating and table styles for various parks and public spaces projects. Parth will also be showing its brand new colors for the 2020 season. Parth sells contract-rated outdoor furniture including benches, </p>',	'91ca15e3bc090ffbb9cb8504769bec6a.jpg',	'2020-01-24',	'active');
