INSERT INTO `pf_content_master` (`cms_id`, `cms_url`, `cms_title`, `cms_metakey`, `cms_metadesc`, `cms_desc`, `cms_window_title`, `cms_image`) VALUES
(1,	'about- us',	'About us',	'About us',	'About us',	'<section class=\"features16 cid-rlUYnRnRDt\" id=\"features16-18\">\n<div class=\"container\">\n<div class=\"row main align-items-center\">\n<div class=\"col-md-6 image-element \">\n<div class=\"img-wrap\"><img alt=\"\" src=\"http://www.parthfibrotech.in/assets/site/images/banner.jpg\" title=\"\"></div>\n</div>\n\n<div class=\"col-md-6 text-element\">\n<div class=\"text-content\">\n<h2 class=\"mbr-title pt-2 mbr-fonts-style align-left display-2\"><strong>Tell Us About Your Product </strong></h2>\n\n<div class=\"mbr-section-text\">\n<p class=\"mbr-text pt-3 mbr-light mbr-fonts-style align-left display-7\"><span xss=\"removed\">We all are concern about our health and we are concern about your health. We manufacture the best outdoor playground gym equipment’s for the park. We have all kinds of equipment which can take care of several parts of your body.</span></p>\n</div>\n\n<div class=\"mbr-section-btn pt-3 align-left\"><a class=\"btn btn-md btn-info display-4\" href=\"http://www.parthfibrotech.in/products\">View Products</a></div>\n</div>\n</div>\n</div>\n</div>\n</section>\n\n<section class=\"mbr-section article content12 cid-rl3Pl1jTZU\" id=\"content12-15\">\n<div class=\"container\">\n<div class=\"row justify-content-center\">\n<div class=\"col-md-4\">\n<h3 class=\"mbr-fonts-style mbr-title mbr-bold pb-2 display-2\"><strong>What We Do</strong></h3>\n\n<div class=\"mbr-text mbr-fonts-style display-7\"><span xss=\"removed\">We are a prominent manufacturer of a high-quality range of Outdoor Multi Play Station, Playground Slides, Playground Equipment’s, Security Cabins and many more. We supply the equipment’s pan India.</span></div>\n</div>\n\n<div class=\"col-md-4\">\n<h3 class=\"mbr-fonts-style mbr-title mbr-bold pb-2 display-2\"><strong>Our Approach</strong></h3>\n\n<div class=\"mbr-text mbr-fonts-style display-7\"><span xss=removed>We take an inclusive approach to help our clients succeed, by providing them with effective equipment’s. We make sure our clients get happy and maintain longevity relations with us.</span></div>\n</div>\n\n<div class=\"col-md-4\">\n<h3 class=\"mbr-fonts-style mbr-title pb-2 display-2\"><strong>Our Mission</strong></h3>\n\n<div class=\"mbr-text mbr-fonts-style display-7\"><span xss=removed>Our products should be effective for the entire individual.  We want to make our presence globally and become one of the best outdoor green gym equipment suppliers.</span></div>\n</div>\n</div>\n</div>\n</section>\n\n<section class=\"mbr-section article content1 cid-rlV0PL5OZF\" id=\"content1-1d\">\n<div class=\"container\">\n<div class=\"media-container-row\">\n<div class=\"col-md-12\"> \n<p> </p>\n\n<p class=\"mbr-text m-0 mbr-fonts-style mbr-black display-7\">Incepted in the year 2007, we, Parth Fibrotech, are a trustworthy organization engaged in manufacturing broad gamut of Outdoor Multi Play Station, Playground Slides, Playground Equipments, Security Cabins and much more. All our offered collection of these products are designed and fabricated by a team of dexterous professionals by following the industry accepted norms and standards. The experts of our organization make use of modern technologies and production methods to design the offered range of playground equipment. Moreover, to ensure the flawlessness of provided products, these are inspected on various quality parameters by our quality analyzers. We also provide Playground Equipment Fabrication Work.<br>\n<br>\nBeing a customer-focused organization of this domain, we strive work towards attaining in an maximum contentment of the esteemed patrons in the efficient manner. Our dedicated professionals works in a close relationship with our valued clients to cater their exact requirements and offer products in accordance to their choice. Further, we have installed upgraded machines and equipment in our infrastructure unit that enables us in catering the varied demands of our valued clients with utmost ease. Owing to our transparent business policies, ethical trade practices and sprawling infrastructure facilities, we have been able to obtain the trust of a huge number of patrons across the nation.<br>\n<br>\nUnder the valuable guidance of our mentor, Mr. Vijay Bobde, we deserve to achieve a commendable position in this domain. His constant motivation, in-depth knowledge, business understanding, brilliant managerial skills and zeal towards achieving all the predefined business tasks in an effective manner have helped us to reach such pinnacle of success in short period of time.</p>\n\n<p> </p>\n\n<p><strong>Company philosophy</strong><br>\nIn 2007, when we set out to deal in outdoor equipment, we had a vision to use the outdoors as a means to better health, unbounding joy and uncompromised safety. Today as we stand together as a team of _____ dedicated professionals working tirelessly to bring only the best quality outdoor equipment, we’re proud of the legacy we have created.</p>\n\n<p><strong>Quality Policy</strong><br>\n -    ISO 9001:2015 certified manufacturing practices<br>\n-    High standards of material sourcing<br>\n-    Well-trained skilled/un-skilled workforce<br>\n-    Stringent quality-testing</p>\n\n<p><strong>Why choose Parth Fibrotech?</strong><br>\nWhether you’re a school, a government organization, a private venue or anything else, when you buy equipment for the outdoors, quality cannot be compromised. Your students, customers, patrons or even family members using substandard outdoor equipment can cause you immense trouble.<br>\nAt Parth Fibrotech, your safety is our absolute first priority. Nothing else matters as the life and well-being of those using our products. We make sure every product delivered from our end goes through a stringent quality-testing. This is why our clients, old and new, can trust our products without a second thought.</p>\n\n<div><strong>Factsheet</strong>\n\n<hr></div>\n\n<div><strong>Basic Information</strong></div>\n\n<table class=\"table table-hover table-bordered table-striped\">\n <tbody>\n  <tr>\n   <th scope=\"row\">Nature of Business</th>\n   <td>Manufacturer</td>\n  </tr>\n  <tr>\n   <th scope=\"row\">Additional Business</th>\n   <td>Exporter, Trader, Service Provider, Distributor</td>\n  </tr>\n  <tr>\n   <th scope=\"row\">Company CEO</th>\n   <td>Vijay Bobde</td>\n  </tr>\n  <tr>\n   <th scope=\"row\">Registered Address</th>\n   <td>Office No. 8,9,10 P- S1 Hotel Rahul Complex, Wadi T Point, Amravati Road, Nagpur- 440023, Maharashtra, India</td>\n  </tr>\n  <tr>\n   <th scope=\"row\">Total Number of Employees</th>\n   <td>101 to 500 People</td>\n  </tr>\n  <tr>\n   <th scope=\"row\">Year of Establishment</th>\n   <td>2008</td>\n  </tr>\n  <tr>\n   <th scope=\"row\">Legal Status of Firm</th>\n   <td>Proprietorship Firm</td>\n  </tr>\n  <tr>\n   <th scope=\"row\">Annual Turnover</th>\n   <td>Rs. 2 - 5 Crore</td>\n  </tr>\n </tbody>\n</table>\n\n<div><strong>Infrastructure</strong></div>\n\n<table class=\"table table-hover table-bordered table-striped\">\n <tbody>\n  <tr>\n   <td>Location Type</td>\n   <td>URBAN</td>\n  </tr>\n  <tr>\n   <td>Building Infrastructure</td>\n   <td>Permanent</td>\n  </tr>\n  <tr>\n   <td>Size of Premises</td>\n   <td>400 square feet</td>\n  </tr>\n  <tr>\n   <td>Space Around</td>\n   <td>Front porch</td>\n  </tr>\n </tbody>\n</table>\n\n<div class=\"j_f col_f he_f f4_f c13_f  b_f p60_f\"><strong>Company USP</strong></div>\n\n<table class=\"table table-hover table-bordered table-striped\">\n <tbody>\n  <tr>\n   <td>Primary Competitive Advantage</td>\n   <td>Experienced R & D Department, Good Financial Position & TQM, Large Production Capacity</td>\n  </tr>\n </tbody>\n</table>\n\n<div class=\"j_f col_f he_f f4_f c13_f  b_f p60_f\"><strong>Statutory Profile</strong></div>\n\n<table class=\"table table-hover table-bordered table-striped\">\n <tbody>\n  <tr>\n   <td>Banker</td>\n   <td>BANK OF BARODA</td>\n  </tr>\n  <tr>\n   <td>GST No.</td>\n   <td>27AQAPB0027C1ZU</td>\n  </tr>\n </tbody>\n</table>\n\n<div class=\"j_f col_f he_f f4_f c13_f  b_f p60_f\"><strong>Packaging/Payment and Shipment Details</strong></div>\n\n<table class=\"table table-hover table-bordered table-striped\">\n <tbody>\n  <tr>\n   <td>Payment Mode</td>\n   <td>DD, Cheque, Cash</td>\n  </tr>\n  <tr>\n   <td>Shipment Mode</td>\n   <td>By Road</td>\n  </tr>\n </tbody>\n</table>\n</div>\n</div>\n</div>\n</section>\n',	'About us',	''),
(2,	'home',	'Home',	'home',	'home',	'<section class=\"features18 cid-rkYKSTe5LB\" id=\"features18-w\">\n<div class=\"container\">\n<div class=\"row justify-content-center content-row\">\n<div class=\"col-md-6 content-column\">\n<h4 class=\"mbr-section-subtitle mbr-fonts-style mbr-white align-left display-5\">Who are we?</h4>\n\n<h2 class=\"mbr-title pt-2 mbr-fonts-style align-left mbr-white display-2\">Parth Fibrotech</h2>\n\n<p class=\"mbr-text mbr-section-text pt-3 mbr-fonts-style align-left mbr-white display-7\">We are a prominent manufacturer of high quality range of Outdoor Multi Play Station, Playground Slides, Playground Equipments, Security Cabins and many more. The offered products are manufactured and designed using cutting-edge technology and superior quality raw material in adherence to international quality standards.</p>\n\n<div class=\"mbr-section-btn pt-3 align-left\"><a class=\"btn btn-md btn-warning display-4\" href=\"http://www.parthfibrotech.in/about-us/\">Company Profile</a></div>\n</div>\n\n<div class=\"col-md-6\">\n<div class=\"row\">\n<div class=\"card p-3 col-md-6\">\n<div class=\"card-box\">\n<div class=\"title\"><span class=\"num mbr-fonts-style mbr-bold m display-1\">01.</span>\n\n<h4 class=\"card-title m-0 mbr-fonts-style mbr-bold mbr-white display-5\">Our Team</h4>\n</div>\n\n<p class=\"mbr-text card-text mbr-fonts-style mbr-white display-7\">We team of dedicated and skilled professionals, deep knowledge and experience in the domain.</p>\n</div>\n</div>\n\n<div class=\"card p-3 col-md-6\">\n<div class=\"card-box\">\n<div class=\"title\"><span class=\"num mbr-fonts-style mbr-bold display-1\">02.</span>\n\n<h4 class=\"card-title mbr-fonts-style m-0 mbr-bold mbr-white display-5\">Our Infrastructure</h4>\n</div>\n\n<p class=\"mbr-text card-text mbr-fonts-style mbr-white display-7\">Established infrastructure equipped with upgraded machines and equipments. </p>\n</div>\n</div>\n\n<div class=\"card p-3 col-md-6\">\n<div class=\"card-box\">\n<div class=\"title\"><span class=\"num mbr-fonts-style mbr-bold display-1\">03.</span>\n\n<h4 class=\"card-title m-0 mbr-fonts-style mbr-bold mbr-white display-5\">Our Vision</h4>\n</div>\n\n<p class=\"mbr-text card-text mbr-fonts-style mbr-white display-7\">Being a customer-focused company attaining maximum contentment of patrons.</p>\n</div>\n</div>\n\n<div class=\"card p-3 col-md-6\">\n<div class=\"card-box\">\n<div class=\"title\"><span class=\"num mbr-fonts-style mbr-bold display-1\">04.</span>\n\n<h4 class=\"card-title mbr-fonts-style m-0 mbr-bold mbr-white display-5\">Our Products</h4>\n</div>\n\n<p class=\"mbr-text card-text mbr-fonts-style mbr-white display-7\">Collection of products are designed and fabricated by industry norms and standards</p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</section>\n',	'home',	'');
