(10,	'',	'FRP Outdoor Multi Play Station',	'',	'',	NULL,	'<div class=\"he14\" id=\"prdcont1\" xss=removed>\n<div class=\"m14\" xss=removed>The <b>FRP Outdoor Multi Play Station</b> gave by us is effectively accessible to customers at spending plan cordial business sector costs. This Kids Combo  Multi Play Station is accessible in various hues, shapes and sizes at to a great degree sensible costs. <br>\n<br>\n<b>Features</b><br>\n \n<ul xss=removed>\n <li xss=removed>Solid configuration</li>\n <li xss=removed>Ultra light</li>\n <li xss=removed>Higher convenience</li>\n</ul>\n\n<p xss=removed> </p>\n\n<p xss=removed><b>Price Range:</b></p>\n\n<p xss=removed> </p>\n\n<ul xss=removed>\n <li xss=removed>2 lakh to 10 lakh</li>\n</ul>\n\n<p xss=removed> </p>\n</div>\n</div>\n',	NULL,	'',	'',	'Approx. Price: Rs 2 Lakh / Unit',	'',	1),
(11,	'',	'Outdoor Playground Station',	'',	'',	NULL,	'<p><span xss=removed>We are one of the prominent Manufacture of </span><b xss=removed>Outdoor Playground Station.</b><span xss=removed> These are manufactured using angle, plate, round pipe, square pipe, M.S, G.I sheet & fiber raw material. We make use of advance machinery and equipment to ensure flawlessness in the end product. Further, the entire range can also be custom designs as per the specifications provided by our clients.</span><br xss=removed>\n </p>\n\n<p xss=removed><b>Features:</b></p>\n\n<p xss=removed> </p>\n\n<ul xss=removed>\n <li xss=removed>\n <p xss=removed>Sturdy built</p>\n </li>\n <li xss=removed>\n <p xss=removed>Corrosion resistant</p>\n </li>\n <li xss=removed>\n <p xss=removed>Easy to install</p>\n </li>\n <li xss=removed>\n <p xss=removed>Safe</p>\n </li>\n</ul>\n\n<p xss=removed> </p>\n\n<p xss=removed><b>Price Range:</b></p>\n\n<p xss=removed> </p>\n\n<ul xss=removed>\n <li xss=removed>5000 to 1 lakh</li>\n</ul>\n\n<p xss=removed> </p>\n',	NULL,	'',	'',	'Approx. Price: Rs 35,000 / Unit',	'',	1),
(12,	'',	'Parth Special Combo Set',	'',	'',	NULL,	'<div class=\"m14\" xss=removed>\n<p xss=removed>Our company is widely appreciated in offering <b>Multiplay Station </b>to the clients. This product can be avail in different sizes, dimensions and other specifications to suit clients&#39; requirements and gain optimum fulfillment. Offered range is designed at widely driven manufacturing unit using the finest quality raw material and advanced technology according to the set industry norms. Mini Combo Set is also tested by quality controllers on various parameters to ensure high strength and robustness. Offered range is widely appreciated by clients.<br>\n<br>\n<b>Features:</b><br>\n </p>\n\n<ul xss=removed>\n <li xss=removed>Sturdy construction</li>\n <li xss=removed>Simple installation</li>\n <li xss=removed>Dimensional accuracy</li>\n</ul>\n\n<p xss=removed><br>\n<b>Price Range:</b><br>\n </p>\n\n<ul xss=removed>\n <li xss=removed>35,000 to 50,000/-</li>\n</ul>\n</div>\n\n<p> </p>\n\n<div class=\"cl m14\" xss=removed><strong>Additional Information:</strong></div>\n\n<ul xss=removed>\n <li xss=removed><strong>Delivery Time: </strong>10 to 15 days</li>\n</ul>\n',	NULL,	'',	'',	'Approx. Price: Rs 35,000 / PieceGet',	'',	1),
(13,	'',	'Children Multi Play Station',	'',	'',	NULL,	'<p><span xss=removed>The </span><b xss=removed>Children Multi Play Station</b><span xss=removed> provided by us is easy to set up and has lower needs for maintenance. This Multi Play Station is economically priced. </span><br xss=removed>\n<br>\n<b xss=removed>Features: </b><br>\n </p>\n\n<ul xss=removed>\n <li xss=removed>Highly colorful design</li>\n <li xss=removed>Trendy appearance</li>\n <li xss=removed>Space saving design</li>\n</ul>\n\n<p xss=removed> </p>\n\n<p xss=removed><b>Price Range:</b></p>\n\n<p xss=removed> </p>\n\n<ul xss=removed>\n <li xss=removed>2 lakh to 10 lakh</li>\n</ul>\n',	NULL,	'',	'',	'Approx. Price: Rs 3.2 Lakh / Unit',	'',	1),
(14,	'',	'Play School Multi Play Station',	'',	'',	NULL,	'<div class=\"m14\" xss=removed>As one of the leading entity of this domain, we are engrossed in providing supreme quality <b>Play School Multi Play Station</b>. The offered multiplay station is manufactured using heavy plastic material to provide a robust and stable platform. The height of the multiplay station can be adjusted. This multiplay station is manufactured adhering to industry standards and quality norms. Such fabrication assures safe and better play for the kids. Clients such as school, play school, other institutions can get the offered multiplay station from us at industry leading rates. <br>\n<br>\n<b>Features:</b>\n<ul xss=removed>\n <li xss=removed>Stable platform</li>\n <li xss=removed>Adjustable height</li>\n <li xss=removed>Attractive and appealing</li>\n</ul>\n\n<p xss=removed> </p>\n\n<p xss=removed><b>Price Range:</b></p>\n\n<ul xss=removed>\n <li xss=removed>2 lakh to 10 lakh</li>\n</ul>\n</div>\n\n<p> </p>\n\n<div class=\"cl m14\" xss=removed><strong>Additional Information:</strong></div>\n\n<ul xss=removed>\n <li xss=removed><strong>Port of Dispatch: </strong>by road,by rail</li>\n <li xss=removed><strong>Production Capacity: </strong>1000</li>\n <li xss=removed><strong>Delivery Time: </strong>10 to 15 days</li>\n</ul>\n',	NULL,	'',	'',	'Approx. Price: Rs 2 Lakh / Unit',	'',	1),
(15,	'',	'Combo Set Playground Slide',	'',	'',	NULL,	'<p><span xss=removed>With a focus on the ever-evolving demands of our customers, we have come up with a wide range of uniquely designed </span><b xss=removed>Combo Set Playground Slide</b><span xss=removed>. Our talented professionals use optimum quality raw material and pioneered technology in the manufacturing process of these Play Ground Combo-Set.</span><br>\n<br>\n<b xss=removed>Price Range:</b><br xss=removed>\n </p>\n\n<ul xss=removed>\n <li xss=removed>20000 to 40000</li>\n <li> </li>\n</ul>\n',	NULL,	'',	'',	'Approx. Price: Rs 37,500 / Unit',	'',	1),
(16,	'',	'Outdoor Multi Play Station',	'',	'',	NULL,	'<div class=\"m14\" xss=removed>With the assistance of our deft team of professionals, we are able to introduce a broad array of <b>Outdoor Multi Play Station</b>. This is one of the latest and medically approved stations manufactured by us. The offered station aids in enhancing the hand and eye coordination of the small wonders. Parents must cheer their children to play such multi play games. Offered station is designed and developed adhering to industry standards and quality norms. As a result, all the edges in the station are made smooth.<br>\n<br>\n<b>Features:</b><br>\n \n<ul xss=removed>\n <li xss=removed>Attractive design</li>\n <li xss=removed>Easy to play and explain</li>\n <li xss=removed>Lightweight and stable</li>\n</ul>\n<br>\n<b>Price Range:</b><br>\n \n<ul xss=removed>\n <li xss=removed>2 lakh to 10 lakh</li>\n</ul>\n</div>\n\n<p> </p>\n\n<div class=\"cl m14\" xss=removed><strong>Additional Information:</strong></div>\n\n<ul xss=removed>\n <li xss=removed><strong>Item Code: </strong>PF-126</li>\n</ul>\n',	NULL,	'',	'',	'Approx. Price: Rs 2 Lakh / Unit',	'',	1),
(17,	'',	'Garden Multi Play Station',	'',	'',	NULL,	'<div class=\"m14\" xss=removed>Since our beginning, we are engaged in presenting a wide range of excellent quality <b>Garden Multi Play Station</b>. This multi play aids kids develop an interest in the sports quite in early age. To offer kids an attractive and comfortable base, we have adhered to international industry standards and quality norms while fabricating the children. High quality plastic and latest technology has been utilized while manufacturing the multi play. Our designers opt for strict quality tests on the edges, shapes, weight and color to assure safe and non-toxic play. <br>\n<br>\n<b>Features:</b><br>\n \n<ul xss=removed>\n <li xss=removed>Perfect height</li>\n <li xss=removed>Lightweight</li>\n <li xss=removed>High durability</li>\n</ul>\n\n<p xss=removed> </p>\n\n<p xss=removed><b>Price Range:</b></p>\n\n<p xss=removed> </p>\n\n<ul xss=removed>\n <li xss=removed>2 lakh to 10 lakh</li>\n</ul>\n\n<p xss=removed> </p>\n\n<p xss=removed> </p>\n\n<p xss=removed> </p>\n\n<p xss=removed> </p>\n</div>\n\n<p> </p>\n\n<div class=\"cl m14\" xss=removed><strong>Additional Information:</strong></div>\n\n<ul xss=removed>\n <li xss=removed><strong>Port of Dispatch: </strong>PARTH FIBROTECH</li>\n <li xss=removed><strong>Delivery Time: </strong>10 TO 15 DAYS</li>\n</ul>\n',	NULL,	'',	'',	'Approx. Price: Rs 40,000 / Unit',	'',	1),
(18,	'',	'FRP Multi Play Station',	'',	'',	NULL,	'<p><span xss=removed>We are successfully ranked amongst the topnotch entity offering a wide range of </span><b xss=removed>FRP Multi Play Station</b><span xss=removed>. This system is developed using plastic material. The offered system has no sharp edges that can harm kids playing with the system. Further, this system has been manufactured adhering to industry standards and quality norms. Also, such fabrication has aided us assure clients about the durability and safety of the system. Using the system, two to three children can play at a time. </span><br xss=removed>\n<br xss=removed>\n<b xss=removed>Features:</b></p>\n\n<ul xss=removed>\n <li xss=removed>Smooth edges and surface</li>\n <li xss=removed>Safe to play</li>\n <li xss=removed>Available in different colors</li>\n</ul>\n\n<p xss=removed> </p>\n\n<p xss=removed><b>Price Range:</b></p>\n\n<ul xss=removed>\n <li xss=removed>2 lakh to 10 lakh</li>\n <li> </li>\n</ul>\n',	NULL,	'',	'',	'Approx. Price: Rs 2 Lakh / Unit',	'',	1),
(19,	'',	'Playground Multi Play Station',	'',	'',	NULL,	'<p><span xss=removed>With a focus on the ever-evolving demands of our customers, we have come up with a wide range of uniquely designed </span><b xss=removed>Playground Multi Play Station</b><span xss=removed>. Our talented professionals use optimum quality raw material and pioneered technology in the manufacturing process of these multi plays. To ensure their quality and comfortability, these multi plays are duly examined on diverse measures of quality in tune with set industry standards. Apart from this, these multi plays are widely appreciated by kids owing to its bright color and comfort rides.</span><br xss=removed>\n </p>\n\n<p xss=removed><b>Price Range:</b></p>\n\n<p xss=removed> </p>\n\n<ul xss=removed>\n <li xss=removed>2 lakh to 10 lakh</li>\n</ul>\n\n<p xss=removed> </p>\n\n<p xss=removed> </p>\n',	NULL,	'',	'',	'Approx. Price: Rs 58,500 / Unit',	'',	1),
(20,	'',	'Multi Play Station',	'',	'',	NULL,	'<div class=\"m14\" xss=removed>Our competency lies in offering our clients an excellent quality range of <b>Multi Play Station</b>. Our offered play station is perfectly designed making use of impeccable quality raw material and the latest methodology under the guidance of deft professionals who hold vast experience in the domain. In addition to this, this play station is highly acknowledged for its compact size and excellent finish in the market. The provided play station is widely used in various places such as parks, gardens, schools, etc. <br>\n<br>\n<b>Specification:-:</b>\n<ul xss=removed>\n <li xss=removed>Age :-5 to 15 Yrs.</li>\n <li xss=removed>Area :- 30 feet X 20 feet.</li>\n <li xss=removed>Plat Form height :- 12 feet.</li>\n <li xss=removed>Leg Support :- 75 mm ID pipe</li>\n <li xss=removed>Spiral slide :- 20 ft. length & 8 ft. height</li>\n <li xss=removed>Land slide :- 12 ft. length & 8 ft. height</li>\n <li xss=removed>Total height :- 15 feet.</li>\n <li xss=removed>Ladder Frame :- 25mm ID pipe</li>\n <li xss=removed>Tread width :-90 mm.</li>\n <li xss=removed>Riser height :-250 mm.</li>\n <li xss=removed>Railing :- 20mm ID pipe</li>\n <li xss=removed>Structure Material:-</li>\n <li xss=removed>The structure are made in 40 mm ID pipe and 32 mm ID pipe.</li>\n</ul>\n<b>Slide and canopy Material:-</b><br>\nSlide are made in FRP material having thickness 7mm. & canopies are made in FRP material providing with thickness of 5mm.<br>\n<br>\n<b>Features:</b><br>\n \n<ul xss=removed>\n <li xss=removed>Attractive design</li>\n <li xss=removed>Smooth surface</li>\n <li xss=removed>Corrosion resistance</li>\n</ul>\n\n<p xss=removed> </p>\n\n<p xss=removed><b>Price Range:</b></p>\n\n<p xss=removed> </p>\n\n<ul xss=removed>\n <li xss=removed>2 lakh to 10 lakh</li>\n</ul>\n</div>\n\n<p> </p>\n\n<div class=\"cl m14\" xss=removed><strong>Additional Information:</strong></div>\n\n<ul xss=removed>\n <li xss=removed><strong>Item Code: </strong>PF-128</li>\n <li xss=removed><strong>Port of Dispatch: </strong>PARTH FIBROTRCH</li>\n <li xss=removed><strong>Delivery Time: </strong>10 TO 15 DAYS</li>\n</ul>\n',	NULL,	'',	'',	'Approx. Price: Rs 2 Lakh / Unit',	'',	1),
(21,	'',	'Fiber Garden Playing Station',	'',	'',	NULL,	'<p><span xss=removed>Leveraging on our intelligent professionals, we are presenting a wide assortment of </span><b xss=removed>Fiber Garden Playing </b><b xss=removed>Station.</b><span xss=removed> This is plastic moulded fiber manufactured using quality plastic material. In order to provide children safe play and peace-of-mind to parents, this fiber is manufactured adhering to international industry standards and quality norms. Such fabrication aids in delivering long working life and safety to the children. Further, the fiber is check on various quality scales to assure better play. </span><br xss=removed>\n<br xss=removed>\n<b xss=removed>Specifications</b><span xss=removed>:                                   </span><br xss=removed>\n<br xss=removed>\n<span xss=removed>Product Area: 6.7M x 2.4M</span></p>\n\n<p xss=removed>Safe Play Area: 7.3M X 3M.</p>\n\n<p><b xss=removed>Features:</b></p>\n\n<ul xss=removed>\n <li xss=removed>Smooth surface</li>\n <li xss=removed>Available in different colors</li>\n <li xss=removed>Easy to install</li>\n</ul>\n\n<p><br>\n<b xss=removed>Price Range:</b></p>\n\n<ul xss=removed>\n <li xss=removed>5,000 to 1,00,000/-</li>\n <li> </li>\n</ul>\n',	NULL,	'',	'',	'Approx. Price: Rs 2.5 Lakh / Unit',	'',	1),
(22,	'',	'Children Playing Multi Play Station',	'',	'',	NULL,	'<div class=\"m14\" xss=removed>\n<p xss=removed>Our company is highly rated in offering <b>Children Playing Multi Play Station</b> to the clients. This product is strictly manufactured by meticulous professionals keeping in mind the set quality standards utilizing supreme quality material and progressive technology. Offered range can be avail in various designs and sizes to cater to different sorts of hassle of valuable customers. Multi play Station is installed in various gardens and schools to maintain the overall physical growth of the kids. Offered range is tested on several standards by quality controllers to make sure excellence.</p>\n\n<p xss=removed> </p>\n\n<p xss=removed><b>Features:</b></p>\n\n<ul xss=removed>\n <li xss=removed>Elegant design</li>\n <li xss=removed>Smooth edge</li>\n <li xss=removed>Long lasting</li>\n</ul>\n\n<p xss=removed><b>Price Range:</b></p>\n\n<ul xss=removed>\n <li xss=removed>2 lakh to 10 lakh</li>\n</ul>\n\n<p xss=removed> </p>\n</div>\n\n<p> </p>\n\n<div class=\"cl m14\" xss=removed><strong>Additional Information:</strong></div>\n\n<ul xss=removed>\n <li xss=removed><strong>Port of Dispatch: </strong>ANY FRIEGHT</li>\n <li xss=removed><strong>Production Capacity: </strong>1 TO 1000</li>\n <li xss=removed><strong>Delivery Time: </strong>10 TO 15 DAYS</li>\n</ul>\n',	NULL,	'',	'',	'Approx. Price: Rs 2.5 Lakh / Unit',	'',	1),
(23,	'',	'School Multiplay Station',	'',	'',	NULL,	'<div class=\"m14\" xss=removed>\n<p xss=removed>Owing to the expertise of our team of experienced professionals, we are able to introduce an exclusive range of <b>School Multiplay Station</b>. It is one of the most interactive and role building activity indoor games available in the domain. This station has been developed adhering to industry standards and quality norms. In addition, such fabrication has aided us assure clients about the durability and safety of the station. Two to three children can play station game at a time.</p>\n\n<p xss=removed><b>Features:</b></p>\n\n<p xss=removed>• Colorful and attractive<br>\n• Custom design can be developed<br>\n• Easy and safe to play</p>\n\n<p xss=removed><b>Price Range:</b></p>\n\n<p xss=removed>• 2 lakh to 10 lakh</p>\n</div>\n\n<p> </p>\n\n<div class=\"cl m14\" xss=removed><strong>Additional Information:</strong></div>\n\n<ul xss=removed>\n <li xss=removed><strong>Item Code: </strong>PF-701</li>\n <li xss=removed><strong>Port of Dispatch: </strong>ANY FRIEGHT</li>\n <li xss=removed><strong>Production Capacity: </strong>1 TO 1000</li>\n <li xss=removed><strong>Delivery Time: </strong>10 TO 15 DAYS</li>\n</ul>\n',	NULL,	'',	'',	'Approx. Price: Rs 2.75 Lakh / Unit',	'',	1),
