(25,	'',	'FRP Kids Multi Play Station',	'',	'',	NULL,	'<p><span xss=removed>Owing to our rich industry experience, we are engaged in manufacturing and supplying an exclusive range of </span><b xss=removed>FRP Kids Multi Play Station</b><span xss=removed>. The offered swing is designed using quality tested raw material and modern technology under the guidance of adroit designers. We offer this swing in different colors and sizes so as to meet the demands of our clients. Moreover, this swing is widely appreciated by the clients for its attractive design, optimum quality and smooth finish.</span><br xss=removed>\n<br xss=removed>\n<b xss=removed>Price Range:</b><br xss=removed>\n </p>\n\n<ul xss=removed>\n <li xss=removed>2 lakh to 10 lakh</li>\n <li> </li>\n</ul>\n',	NULL,	'',	'',	'Approx. Price: Rs 2 Lakh / Unit',	'',	1),
(26,	'',	'Multi Play Outdoor Station',	'',	'',	NULL,	'<p><span xss=removed>We are a noteworthy organization in the domain, involved in providing high quality </span><b xss=removed>Multi Play Outdoor Station</b><span xss=removed> that is widely applauded in schools, playgrounds, parks and other similar places. The offered slide is designed and manufactured by our adept professionals using quality tested raw material and progressive technology in compliance with defined industry standards. Our provided slide is highly in demands owing to its unique features such as attractive look and vibrant colors. In addition to this, we offer this slide at a reasonable price to our valuable clients.</span></p>\n\n<p xss=removed> </p>\n\n<p xss=removed><b>Features</b>:</p>\n\n<ul xss=removed>\n <li xss=removed>Durable</li>\n <li xss=removed>High strength</li>\n <li xss=removed>Robust construction</li>\n <li xss=removed>Reliable</li>\n</ul>\n\n<p xss=removed> </p>\n\n<p xss=removed><b>Price Range:</b></p>\n\n<ul xss=removed>\n <li xss=removed>2 lakh to 10 lakh</li>\n <li> </li>\n</ul>\n',	NULL,	'',	'',	'Approx. Price: Rs 2 Lakh / Unit',	'',	1),
