(30,	'',	'Outdoor Multi Play Station',	'',	'',	NULL,	'<div class=\"m14\" xss=removed>Leveraging on our in-house production unit, we are presenting a wide assortment of <b>Outdoor Multi Play Station</b>. This is a plastic moulded product developed using quality plastic material. This multiplay is manufactured adhering to international industry standards and quality norms to provide kids a safe play and peace-of-mind to parents. Such fabrication assists in delivering long working life and safety to the children. Further, the multiplay is check on various quality scales to assure better play. <br>\n<br>\n<b>Features:</b><br>\n \n<ul xss=removed>\n <li xss=removed>Smooth surface</li>\n <li xss=removed>Available in different colors</li>\n <li xss=removed>Easy to install</li>\n</ul>\n\n<p xss=removed> </p>\n\n<p xss=removed><b>Price Range:</b></p>\n \n\n<ul xss=removed>\n <li xss=removed>2 lakh to 10 lakh</li>\n</ul>\n\n<p xss=removed> </p>\n</div>\n\n<p> </p>\n\n<div class=\"cl m14\" xss=removed><strong>Additional Information:</strong></div>\n\n<ul xss=removed>\n <li xss=removed><strong>Item Code: </strong>PF-124MPPS</li>\n <li xss=removed><strong>Port of Dispatch: </strong>AN FRIEGHT</li>\n <li xss=removed><strong>Production Capacity: </strong>1 TO 1000</li>\n <li xss=removed><strong>Delivery Time: </strong>10 TO 15 DAYS</li>\n</ul>\n',	NULL,	'',	'',	'Approx. Price: Rs 2 Lakh / Unit',	'',	1),
(31,	'',	'Outdoor Children Playing Garden Slide And Swing',	'',	'',	NULL,	'<p><span xss=removed>Our products Outdoor Children Playing Garden Slide and Swing are widely acclaimed among the customers for their features like perfect polish, optimum finishing, scratch-proof nature and high durability. We export our products all over the world. Further, these products are tested by our quality controllers on various quality</span></p>\n\n<div> </div>\n',	NULL,	'',	'',	'Approx. Price: Rs 57,999 / Piece',	'',	4),
(32,	'',	'Balancing Bridge',	'',	'',	NULL,	'<div class=\"m14\" xss=removed>By keeping track of present market development, we are offering an outstanding range of <b>Balancing Bridge.</b> Our professionals manufacture this hammock swing utilizing the best quality material and sophisticated technology. Offered hammock swing is checked by our team of quality managers to ensure the flawlessness before dispatch. This array is made available in several specifications to choose from.<br>\n<br>\n<b>Features:</b>\n<ul xss=removed>\n <li xss=removed>Easy to install</li>\n <li xss=removed>High strength</li>\n <li xss=removed>Weather resistance</li>\n</ul>\n<br>\n<b>Price Range:</b><br>\n \n<ul xss=removed>\n <li xss=removed>10,000 to 40,000/-</li>\n</ul>\n</div>\n\n<p> </p>\n\n<div class=\"cl m14\" xss=removed><strong>Additional Information:</strong></div>\n\n<ul xss=removed>\n <li xss=removed><strong>Item Code: </strong>PF-412</li>\n <li xss=removed><strong>Port of Dispatch: </strong>PARTH FIBROTECH</li>\n <li xss=removed><strong>Delivery Time: </strong>10 TO 15 DAYS</li>\n</ul>\n',	NULL,	'',	'',	'Approx. Price: Rs 10,000 / Unit',	'',	4),
