(34,	'',	'Nursery Slide Combo Set',	'',	'',	NULL,	'<div class=\"he14\" id=\"prdcont4\" xss=removed>\n<div class=\"m14\" xss=removed>Backed by our rich industrial experience in this domain, we are committed towards offering wide gamut of <b>Nursery Slide Combo Set.</b> Our products are fabricated by high quality material and contemporary tools in compliance with set industrial standards. Our offered set is made available in various specifications for our clients to choose from. We offer this set at affordable prices to our clients.<br>\n<br>\n<b>Specification : </b><br>\n<br>\nProviding & fixing nursery combo set FRP common Slide 2 no.\n<p xss=removed><b>2.</b>Providing & fixing Height 1.2m, Width of slide 0.5, Length of Slide each 3m. &</p>\n\n<p xss=removed>thickness of slide is 5 to 6 mm. frp sheet.</p>\n\n<p xss=removed><b>3</b>.Main frame 40mmx2.5mm (thickness)@ NB. Pipe</p>\n\n<p xss=removed><b>4</b>. Plate form of steel frame of 16g M.S. sheet with support of 25x25x3 angle</p>\n\n<p xss=removed><b>5</b>.Ralling of 20x2mm (thickness) pipe</p>\n\n<p xss=removed><b>6</b>.FRP should be 8 Length and 0.5 Mtr. Wide</p>\n\n<p xss=removed><b>7</b>.Stairs made up of square pipe of 100x50mm.& 25x25x3 angle main frame, stairs & FRP should properly fixed with support of flat 40x5 with each other with nut bolting system. Ideal for the age group 4-14yrs.</p>\n<b>8.</b>Painting:- Structures have to be powder coated by best quality polyurethane paints.& should be provided with hole passes for proper grip fixing with 1:2:4 cement concrete<br>\n<br>\n<b>Features:</b>\n\n<ul xss=removed>\n <li xss=removed>Stable base</li>\n <li xss=removed>Water resistance</li>\n <li xss=removed>Smooth sliding</li>\n</ul>\n<br>\n<b>Price Range:</b><br>\n \n<ul xss=removed>\n <li xss=removed>20,000 to 40,000/-</li>\n</ul>\n</div>\n \n\n<div class=\"cl m14\" xss=removed><strong>Additional Information:</strong></div>\n\n<ul xss=removed>\n <li xss=removed><strong>Port of Dispatch: </strong>parth fibr