(36,	'',	'Fun Park Equipment',	'',	'',	NULL,	'<div class=\"he14\" id=\"prdcont6\" xss=removed>\n<div class=\"m14\" xss=removed>We are the prominent organization of this domain engaged in offering a wide spectrum of <b>Fun Park Equipment</b>. The offered equipment is developed in accordance to industry norms and quality parameters. In the offered equipment, our professionals use the approved material during the manufacturing process. In addition, this equipment can be built and developed according to the specification provided by the clients. Furthermore, our professionals opt for strict quality inspection made on the equipment to ensure high performance.<br>\n<br>\n<b>Features:</b><br>\n \n<ul xss=removed>\n <li xss=removed>Attractive design</li>\n <li xss=removed>Easy to play and explain</li>\n <li xss=removed>Light weight and stable</li>\n</ul>\n<br>\n<b>Price Range:</b><br>\n \n<ul xss=removed>\n <li xss=removed>5,000 to 1,00,000/-</li>\n</ul>\n</div>\n \n\n<div class=\"cl m14\" xss=removed><strong>Additional Information:</strong></div>\n\n<ul xss=removed>\n <li xss=removed><strong>Port of Dispatch: </strong>PARTH FIBROTECH</li>\n <li xss=removed><strong>Production Capacity: </strong>1 to 1000</li>\n <li xss=removed><strong>Delivery Time: </strong>10 TO 15 DAY</li>\n</ul>\n</div>\n\n<div class=\"fl m6 raq_btn\" xss=removed> </div>\n',	NULL,	'',	'',	'Approx. Price: Rs 5,000 / Unit',	'',	4),
