(38,	'',	'Garden Fiber Slide',	'',	'',	NULL,	'<div class=\"he14\" id=\"prdcont8\" xss=removed>\n<div class=\"m14\" xss=removed>\n<p xss=removed>Wide range of <b>Garden Fiber Slide</b> with various combinations of slides, crawling tunnel, climber, suspended bridge, etc. The gigantic structure aesthetically designed for catering a huge number of children at a time with maximum safety. The combination of various Amusement Park Equipments can be customized.</p>\n\n<p xss=removed><b>Specification </b>:</p>\nAge group: 4-12 yrs.<br>\nProduct area: 6.7, x 1.4 mts<br>\nSafe play area: 7.7, x 2.4 mts<br>\nProduct height: 3.2 mts<br>\nPlatform height: 2.1 mts\n<p xss=removed><b>Price Range:</b></p>\n\n<p xss=removed>• 5,000 to 1,00,000/-</p>\n</div>\n</div>\n',	NULL,	'',	'',	'Approx. Price: Rs 20,000 / Unit',	'',	4),
(39,	'',	'Amusement Park Multi Play Station',	'',	'',	NULL,	'<div class=\"he14\" id=\"prdcont9\" xss=removed>\n<div class=\"m14\" xss=removed>We feel proud to introduce ourselves as the leading organization in this domain, engaged in presenting an excellent grade of <b>Amusement Park Multi Play Station</b>. This equipment is developed using quality material and higher technologies. Our professionals opt for strict quality tests throughout the production of the equipment to guarantee optimum performance. The provided equipment is made accessible in different capacities. Provided equipment is built for heavy operations. Besides, clients can get the equipment from us at industry leading rates. <br>\n<br>\n<b>Specification : </b><br>\n \n<ul xss=removed>\n <li xss=removed>Age group: 5-12 yrs.</li>\n <li xss=removed>Product area: 9.7, x 9.6 mts</li>\n <li xss=removed>Safe play area: 11.7, x 11.6 mts</li>\n <li xss=removed>Product height: 4.5 mts</li>\n</ul>\n<br>\n<b>Features:</b><br>\n \n<ul xss=removed>\n <li xss=removed>Perfect height</li>\n <li xss=removed>Lightweight</li>\n <li xss=removed>High durability</li>\n</ul>\n\n<p xss=removed> </p>\n\n<p xss=removed><b>Price Range:</b></p>\n\n<p xss=removed> </p>\n\n<ul xss=removed>\n <li xss=removed>5,000/- -1,00,000/-</li>\n</ul>\n</div>\n</div>\n',	NULL,	'',	'',	'Approx. Price: Rs 2.21 Lakh / Unit',	'',	4);
